import React from "react";
import {
  Map,
  InfoWindow,
  Marker,
  GoogleApiWrapper
} from "google-maps-react";

const myApiKey = "AIzaSyCNn_ezyRyN-r88ZLhixrorglnHwu1ATng";

export class MyMap extends React.Component {
  render() {
    return ( <
      Map google = {
        this.props.google
      }
      zoom = {
        14
      }
      initialCenter = {
        {
          lat: 41.451774,
          lng: 15.616402
        }
      } >
      <
      Marker onClick = {
        this.onMarkerClick
      }
      name = {
        "Current location"
      }
      /> <
      /Map>
    );
  }
}

export default GoogleApiWrapper({
  apiKey: myApiKey
})(MyMap);
